// particles.js
import React from 'react';


function ParticlesComponent({ className }) {
  return (
    <Particles
      className={className}
      options={{
        particles: {
          number: {
            value: 100,
          },
          size: {
            value: 3,
          },
          move: {
            speed: 2,
          },
        },
      }}
    />
  );
}

export default ParticlesComponent;
